import React from 'react';
import TimerComponent from './TimerComponent'; // Import your TimerComponent
import StatsComponent from './StatsComponent'; // Import your StatsComponent

function PostLogin() {
  return (
    <div>
      <h2>Welcome to the Post-Login Page!</h2>
      <TimerComponent />
      <StatsComponent />
    </div>
  );
}

export default PostLogin;
